import React from 'react'
import { StyleSheet } from 'react-native'
import { View, Text, Image} from 'react-native'

export default function TopBar(){
    return (
        <View style={styles.container}>
            <View style={styles.topIcons}>
                <Image style={styles.iconPic} source={require('../../assets/foto.png')}></Image>
                <Image style={styles.iconEye} source={require('../../assets/visualizar.png')}></Image>
                <Image style={styles.iconHelp} source={require('../../assets/ajuda.png')}></Image>
                <Image style={styles.iconPerson} source={require('../../assets/do-utilizador.png')}></Image>

            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        height: "25%",
        width: "100%",
        backgroundColor: '#800AD0'
    },
    topIcons:{
        flexDirection: 'row',
        marginTop: 30
    },
    iconEye:{
        height: 25,
        width: 35,
    },
    iconHelp:{
        height: 25,
        width: 25,
    },
    iconPerson:{
        height: 20,
        width: 25,
    },
    iconPic:{
        backgroundColor: 'grey',
        borderRadius: 15,
        height: 35,
        width: 35,
    }
})
